const duration = 40;

const pathData = [
    { d: body, duration: duration },
    { d: collier, duration: duration },
    { d: innerFace, duration: duration / 10 }
];

const Avatar: React.FC<React.SVGProps<SVGSVGElement>> = (props) => {
    const [initialAnimationComplete, setInitialAnimationComplete] = useState(false);

    useEffect(() => {

        // Clean up the animation complete listener
        return () => {
          setInitialAnimationComplete(false);
        };
      }, []);

    return (
        <div className='avatar-container'>
            <svg {...props} viewBox='0 0 515 608' xmlns="http://www.w3.org/2000/svg">
                {pathData.map((path, index) => (
                    <motion.path
                        key={index}
                        d={path.d}
                        initial={{ pathLength: 0 }}
                        animate={{ pathLength: 1 }}
                        transition={{ duration: path.duration }}
                        onAnimationComplete={v => setInitialAnimationComplete(true)}
                    />
                ))}    
            </svg>
            <AnimatePresence>
                {initialAnimationComplete && (
                    <motion.div
                        initial={{ opacity: 0 }}
                        animate={{ opacity: 1 }}
                        transition={{ duration: 1 }}>
                            <Fills className='avatar-fills'></Fills>
                    </motion.div>
                )}
            </AnimatePresence>
        </div>
    )
}

export default Avatar;